function findSubstring(s: string, words: string[]): number[] {
  const sLength = s.length
  const wordsLength = words.length
  if (sLength === 0 || wordsLength === 0) return []
  const wLength = words[0].length
  const strLength = wLength * wordsLength
  const wordMap = new Map<string, number>()
  for (const word of words) {
    if (wordMap.has(word)) {
      wordMap.set(word, wordMap.get(word)! + 1)
    } else {
      wordMap.set(word, 1)
    }
  }
  const res = []
  out: for (let i = 0; i <= sLength - strLength; i++) {
    const strMap = new Map<string, number>()
    for (let j = 0; j < wordsLength; j++) {
      let innerStr = s.slice(i + j * wLength, i + (j + 1) * wLength)
      if (wordMap.has(innerStr)) {
        if (strMap.has(innerStr)) {
          strMap.set(innerStr, strMap.get(innerStr)! + 1)
          if (strMap.get(innerStr)! > wordMap.get(innerStr)!) continue out
        } else {
          strMap.set(innerStr, 1)
        }
      } else {
        continue out
      }
    }
    res.push(i)
  }
  return res
}

